import React from "react";
import "./main.css";

export default function Main() {
  return (
    <main className="main">
      <div className="main-left">
        <div className="groups-list">
          <ul className="list-category">
            <li><svg className="w-6 h-6" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fillRule="evenodd" d="M18 5v8a2 2 0 01-2 2h-5l-5 4v-4H4a2 2 0 01-2-2V5a2 2 0 012-2h12a2 2 0 012 2zM7 8H5v2h2V8zm2 0h2v2H9V8zm6 0h-2v2h2V8z" clipRule="evenodd" /></svg></li>
            <li><svg className="w-6 h-6" fill="currentColor" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path fillRule="evenodd" d="M18 5v8a2 2 0 01-2 2h-5l-5 4v-4H4a2 2 0 01-2-2V5a2 2 0 012-2h12a2 2 0 012 2zM7 8H5v2h2V8zm2 0h2v2H9V8zm6 0h-2v2h2V8z" clipRule="evenodd" /></svg></li> 
          </ul>
        </div>
        {/* ----- */}
        <hr className="line-space">
        </hr>
      </div>
      <div className="main-center">
        <p>C</p>
      </div>
      <div className="main-right">
        <p>R</p>
      </div>
    </main>
  );
}
